  return (
    <div className='footer'>
      <div className='footerHeader'>
        <h1>Don't waste time to reach your goals!</h1>
        <p>Join over 50.000 happy users now.</p>
        <MyButton name='Start Now' />
      </div>
    </div>
  );
}

export default Footer;
